import { Component } from 'react';
import { Route, Switch } from 'react-router';
import './App.css';
import Home from './Home';
import Signup from './Signup';
import Login from './Login';


class App extends Component {
    render() {
      return (
        <Router>
            <div className="app">
            <Switch>
              <Route>
                <Home />
              </Route>
              <Route>
                  <Login />
                </Route>
                <Route>
                  <Signup />
                </Route>
              </Switch>
            </div>
        </Router>

      );
    }
}

export default App;
